import React from "react";
import { Formik, useFormik, Form, Field } from "formik";
import * as Yup from "yup";
import './register.css'
import axios from "axios";

function Register() {
  const initialValues = {
    email: "",
    password: "",
    username: "",
    confirm_password: "",

  };

  const validationSchema = Yup.object({
    email: Yup.string()
      .email("Invalid email address format")
      .required("Email is required"),
    password: Yup.string()
      .min(8, "Password must be 8 characters at minimum")
      .required("Password is required"),
    confirm_password: Yup.string()
      .min(8, "Confirm password must be same as Password ")
      .required("Password is required"),
    username: Yup.string()
      .min(8, "Username must be 8 characters at minimum")
      .required("Username is required")
  });

  const onSubmit = (values) => {
    alert("values are:", JSON.stringify(values, null, 2));
  };

  return (
    <div>
      <div className="main-div">
        <div className="card card-info col-md-6 offset-md-3">
          <div className="card-header">
            <h3 className="card-title">Sign Up </h3>
          </div>
          <Formik
            initialValues={initialValues}
            validationSchema={validationSchema}
            onSubmit={(values) => {
              console.log(values);
              axios.post("http://localhost:8000/register/", values).then(res => {
                console.log(res)
              }).catch(err => {
                Object.values(err.response.data).map(error => {
                  console.log(error)
                  error.map(data => {
                    alert(data)
                  })
                })
              })
            }}
          >
            {({ errors, touched }) => (
              <Form className="form-horizontal">
                <div className="card-body">
                  <div className="form-group row">
                    <label
                      htmlFor="email"
                      className="col-sm-2 col-form-label"
                    >
                      Email
                    </label>
                    <div className="col-sm-10">
                      <Field name="email" />
                      {errors.email && touched.email ? (
                        <div>{errors.email}</div>
                      ) : null}
                    </div>
                  </div>
                  <div className="form-group row">
                    <label
                      htmlFor="username"
                      className="col-sm-2 col-form-label"
                    >
                      Username
                    </label>
                    <div className="col-sm-10">
                      <Field name="username" />
                      {errors.username && touched.username ? (
                        <div>{errors.username}</div>
                      ) : null}
                    </div>
                  </div>
                  <div className="form-group row">
                    <label
                      htmlFor="inputPassword"
                      className="col-sm-2 col-form-label"
                    >
                      password
                    </label>
                    <div className="col-sm-10">
                      <Field name="password" type="password" />
                      {errors.password && touched.password ? (
                        <div>{errors.password}</div>
                      ) : null}
                    </div>
                  </div>
                  <div className="form-group row">
                    <label
                      htmlFor="confirmPassword"
                      className="col-sm-2 col-form-label"
                    >
                      Confirm Password
                    </label>
                    <div className="col-sm-10">
                      <Field name="confirm_password" type="password" />
                      {errors.confirm_password && touched.confirm_password ? (
                        <div>{errors.confirm_password}</div>
                      ) : null}
                    </div>
                  </div>
                  <div className="card-footer">
                    <button type="submit" className="btn btn-info">
                      Sign Up
                    </button>
                  </div>
                </div>
              </Form>
            )}
          </Formik>
        </div>
      </div>
      {/* <Formik
        initialValues={initialValues}
        validationSchema={validationSchema}
        onSubmit={(values) => {
          console.log(values);
        }}
      >
        {({ errors, touched }) => (
          <Form>
            <label htmlFor="firstName">First Name</label>
            <Field name="firstName" />
            {errors.firstName && touched.firstName ? (
              <div>{errors.firstName}</div>
            ) : null}
            <label htmlFor="firstName">Last Name</label>
            <Field name="lastName" />
            {errors.lastName && touched.lastName ? (
              <div>{errors.lastName}</div>
            ) : null}
            <label htmlFor="firstName">Email</label>
            <Field name="email" type="email" />
            {errors.email && touched.email ? <div>{errors.email}</div> : null}
            <button type="submit">Submit</button>
          </Form>
        )}
      </Formik> */}
    </div>
  );
}

export default Register;
